import React from 'react';

import classes from './ViewCard.module.css';

const viewCard = (props) => (
           <div className = {props.icon == null ? classes.ContainerCard : classes.ContainerCardWithIcon}>
                {props.icon == null ? null : <img  className = {classes.Icon} src = {props.icon}/>}
                <div className = {props.icon == null ? classes.TitleCard : classes.TitleCardWithIcon}>{props.title}<strong>{props.strongTitle}</strong></div>
                <div className = {props.icon == null ? classes.LineCard : classes.LineCardWithIcon}></div>
                <div className = {props.icon == null ? classes.BodyCard : classes.BodyCardWithIcon}>{props.body}</div>
           </div> 
    );

export default viewCard;
